css:
.toolbar-DraftList {
  height: 100%;
  background: #1E1E2E;
  border: none;
  border-left: 1px solid transparent;
}
.toolbar-DraftList .selection-bar .absolute {
  background: #1E1E2E;
  border-color: #1E1E2E;
}
.toolbar-DraftList .btn-toolbar {
  box-shadow: none;
  background: transparent;
  border: 1px solid transparent;
  border-radius: 3px;
  height: 26px;
  color: #c9cbff;
}
.toolbar-DraftList .btn-toolbar img.content-mask {
  background-color: #c9cbff;
}
.toolbar-DraftList .btn-toolbar:hover {
  background: #302d41;
  border-color: #1a1826;
}
.toolbar-DraftList .btn-toolbar:active {
  background: #C9CBFF;
  border-color: #C9CBFF;
  color: #1A1826;
}
.toolbar-DraftList .btn-toolbar:active img.content-mask {
  background-color: #1A1826;
}
.toolbar-DraftList .inner .centered {
  padding-top: 3px;
  color: rgba(217, 224, 238, 0.8) !important;
}
